// llamada a api de supabase

import { createClient } from '@supabase/supabase-js'

const supabaseUrl = 'https://xfoffqccaewuaeiyclpi.supabase.co'
const supabaseKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Inhmb2ZmcWNjYWV3dWFlaXljbHBpIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MzExNDg2NjksImV4cCI6MjA0NjcyNDY2OX0.aNEQJWMTEPBq8gCnae912hXYnbs28PbZwVkUEIE9kzE'

const supabase = createClient(supabaseUrl, supabaseKey)

// fetch data de la tabla prueba que esta en public

const fetchData = async () => {
    const { data, error } = await supabase
        .from('prueba')
        .select('*')
    console.log(data)

    if (error) {
        console.log('Error fetching data:', error.message)
    }
}





